import React from 'react';
import './Home.css';

function Home() {
  const cars = [
    {
      id: 1,
      title: 'Toyota Camry',
      price: '25000',
      year: '2020',
      image: 'https://via.placeholder.com/300x200'
    },
    {
      id: 2,
      title: 'Honda Accord',
      price: '22000',
      year: '2019',
      image: 'https://via.placeholder.com/300x200'
    },
    {
      id: 3,
      title: 'BMW X5',
      price: '45000',
      year: '2021',
      image: 'https://via.placeholder.com/300x200'
    }
  ];

  return (
    <div className="home">
      <div className="hero">
        <h1>Добро пожаловать на Mashina.kg</h1>
        <p>Найдите свой идеальный автомобиль</p>
      </div>
      
      <div className="cars-grid">
        {cars.map(car => (
          <div key={car.id} className="car-card">
            <img src={car.image} alt={car.title} />
            <h3>{car.title}</h3>
            <p>Год: {car.year}</p>
            <p>Цена: ${car.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
